import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'
import Typing from 'react-typing-animation';

class TitleText extends Component {

  constructor()
  {

    super();

    this.arr_description = [
      'Conheca nossa historia',
      'Nossos Pilares',
      'Nossa Missao',
      'Nossa visao de futuro',
    ];
    //loop

  }

  render() {
    return (
      <div data-component="cover-page">

        <div className="container-page hidden">

          <p data-title>Sobre Nos</p>

          <Typing>
            <div>
              There will be a 1000ms delay here,
              <Typing.Delay ms={1000} />
              <Typing.Backspace count={20} />
              then this will be typed.
            </div>
          </Typing>

        </div>
      </div>
    );
  }
}
export default TitleText;
